import React from "react";
import { Link } from "react-router-dom";
import './index.scss';

const Curp = () => {

    return (
        <>
            <div className="curp-container">
                <div className="checkbox">
                    <p>Genero</p>
                    <label htmlFor=""></label>
                    <input
                        type="checkbox"
                        id="genre"
                        name="genre"
                        value="Masculino"
                    />
                </div>
            </div>
        </>
    );
};

export default Curp;
